import React from "react";
import { useEffect, useState } from "react";
import axios from "axios";
function HomeImg() {
  const [img, setimg] = useState([]);
  const fetchCouses = async () => {
    try {
      const response = await axios.get("http://localhost:3004/homeImg");
      setimg(response.data);
    } catch (error) {
      console.log(error);
    }
  };
  useEffect(() => {
    fetchCouses();
  }, []);
  return (
    <div>
      <div className=" relative w-full h-[675px] bg-gray-400">
        <div className=" absolute top-0 w-full h-[675px]"></div>
      </div>
    </div>
  );
}

export default HomeImg;
